import React from 'react';

const AboutMeCard = () => {
    return (
        <div id='about-me-card' className='br3 pa3 ma2 bw2 shadow-5'>
            <h3>Who am I?</h3>
            <hr></hr>
            <p>I am an aspiring <a href='https://dictionary.cambridge.org/dictionary/english/polymath' rel='noopener noreferrer' target='_blank'>polymath</a>.</p>
            <p>I am a Physiologist. I am a Web Developer. I am a Teacher. I am a sports & exercise fanatic.</p>
            <p>My personality assessment suggests that I am heavily concerned with 'people mastery'.</p>
            <p>I love everything about the natural world and I am fascinated by the world that we've built, too.</p>
            <hr></hr>
            <p>I made this website with newly acquired React Native skills, and lots of patience.</p>
            <p>You can find all of my education and work experience information.</p>
            <hr></hr>
        </div>
    )
}

class AboutMe extends React.Component {
    render() {
        return (
            <div className='flex flex-column items-center'>
                <AboutMeCard />
            </div>
        )
    }
}

export default AboutMe;
